// ==UserScript==
// @name         Bilibili Music Mode
// @namespace    http://tampermonkey.net/
// @version      2025-11-20
// @description  Bilibili Music Mode / 切换web版bilibili为音乐播放模式
// @author       You
// @match        https://www.bilibili.com/*
// @icon         data:image/gif;base64,R0lGODlhAQABAAAAACH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    // 读取模式，默认是 videoMode
    let playerMode = localStorage.getItem('playerMode') || 'videoMode';

    // 样式定义
    const musicStyle = `
.video-tag-container,
.bpx-player-sending-bar,
.strip-ad-inner,
.up-panel-container,
.slide-gg,
.fixed-sidenav-storage,
.video-info-meta,
.recommend-list-v1,
.ad-report,
.danmaku-box,
.recommend-list-container,
.video-desc-container,
.activity-m-v1,
.left-entry{
    display: none !important;
}
.right-entry-item--upload{
    display: none !important;
}
.video-toolbar-container{
    opacity: 0 !important;
    pointer-events: none !important;
}
.bpx-player-video-wrap video{
    display: none !important;
}

.player-wrap{
    height: 120px !important;
}
.bpx-player-primary-area{
    height: 120px !important;
}
.bpx-player-top-left-follow{
    display: none !important;
}
.video-info-title h1{
    font-size: 14px !important;
    opacity: 0.3;
}
.vip-wrap, .right-entry--message, .header-avatar-wrap{
    display: none !important;
}
.bpx-player-video-area{
    background-color: white !important;
}
#playlistToolbar{
  opacity: 0 !important;
  pointer-events: none !important;
}
#commentapp{
    display: none !important;
}
.bpx-player-container{
    box-shadow: none !important;
}
body{
    background-color: white !important;
}
.action-list-container{
    opacity: 0.1;
}
.right-entry, .center-search-container{
    opacity: 0.4;
}
    `;

    const videoStyle = `
/* 这里可以添加 videoMode 的样式，如果需要的话 */
    `;

    // 移除旧样式
    const removeStyles = () => {
        const existingStyles = document.querySelectorAll('style');
        existingStyles.forEach(style => {
            if (style.innerText.includes('video-tag-container')) {
                style.remove();
            }
        });
    };

    const applyStyles = (mode) => {
        removeStyles();
        const style = document.createElement('style');
        style.innerText = mode === 'musicMode' ? musicStyle : videoStyle;
        document.head.appendChild(style);
    };

    // 应用初始样式
    applyStyles(playerMode);

    // 创建悬浮按钮
    const button = document.createElement('button');
    button.innerText = playerMode === 'musicMode' ? '切换到视频模式' : '切换到音乐模式';
    button.style.position = 'fixed';
    button.style.bottom = '20px';
    button.style.right = '20px';
    button.style.zIndex = '9999';
    button.style.padding = '10px';
    button.style.backgroundColor = 'rgba(0, 0, 0, 0.7)';
    button.style.color = 'white';
    button.style.border = 'none';
    button.style.borderRadius = '5px';
    button.style.cursor = 'pointer';
    document.body.appendChild(button);

    // 切换模式的函数
    const toggleMode = () => {
        playerMode = playerMode === 'musicMode' ? 'videoMode' : 'musicMode';
        localStorage.setItem('playerMode', playerMode);
        applyStyles(playerMode);
        button.innerText = playerMode === 'musicMode' ? '切换到视频模式' : '切换到音乐模式';
        document.querySelector('#my-logo-img').style.display = playerMode === 'musicMode'?'inherit': 'none'
    };

    // 按钮点击事件
    button.addEventListener('click', toggleMode);

    // 快捷键切换
    document.addEventListener('keydown', (event) => {
        if (event.altKey && event.key === 'z') {
            toggleMode();
        }
    });

    function sleep(ms) {
        return new Promise(resolve => setTimeout(resolve, ms));
    }

    async function startDetect() {
        while (true) {
            await sleep(500);
            // 查找所有的弹窗元素
            const header = document.querySelector('.bili-header__bar.mini-header')
            const logoEle = document.querySelector('#my-logo-img')
            if (header && !logoEle){
                const logo = document.createElement('img')
                logo.src = "data:image/png;base64,"
                logo.style.height = '60px'
                logo.id = 'my-logo-img'
                header?.prepend(logo)
            }
        }
    }

    startDetect();
})();
